import React from 'react';

const TermsAndConditions = () => {
  return (
    <div className="terms-and-conditions">
      <h1>Terms and conditions</h1>
      <div className="tabs">
        <div className="tab">Introduction</div>
        <div className="tab">Booking conditions</div>
        <div className="tab">Cancellation policy</div>
        <div className="tab">No-show policy</div>
        <div className="tab">Payment policy</div>
        <div className="tab">Privacy policy</div>
      </div>
      <div className="content">
        <section className="introduction">
          <h2>1. Introduction</h2>
          <p>The following terms and conditions apply to all bookings made by a guest through our website or the hotel directly...</p>
        </section>
        <section className="booking-conditions">
          <h2>1.2. Booking Conditions</h2>
          {/* Content here */}
        </section>
        <section className="cancellation-policy">
          <h2>1.3. Cancellation Policy</h2>
          {/* Content here */}
        </section>
        <section className="no-show-policy">
          <h2>1.4. No-Show Policy</h2>
          {/* Content here */}
        </section>
        {/* More sections for each tab */}
      </div>
    </div>
  );
};

export default TermsAndConditions;
